import React from "react";
import {foods} from "../data/foods";
import "./Foods.scss"

const Foods = () => {

    return (
        <div className="food">
            {foods.map(food => (
                <div className="eachfood">
                    <img className="foodpic" src={food.image}/>
                    <div className="info">
                        <p className="caption">{food.caption}</p>
                        <p className="mood"></p>
                    </div>
                </div>
                )
            )}
        </div>
    )
}

export default Foods
